import React from 'react';
import { Table } from '../../Ui/Table';
import TableHeader from './TableHeader';
import TableContent from './TableContent';

export interface ProductsTableProps {
  products: Products[];
  productsLoading: boolean;
  productsError: any;
}

interface Products {
  id: string;
  title: string;
  price: number;
  inventory: string;
}

const ProductsTable: React.SFC<ProductsTableProps> = ({ products, productsLoading, productsError }) => {
  if (productsLoading)
    return (
      <Table className="table-borderless mb-4 col-12">
        <TableHeader />
      </Table>
    );

  return (
    <div className="col-12">
      <Table className="table-borderless mb-4">
        <TableHeader />
        <TableContent products={products} productsLoading={productsLoading} productsError={productsError} />
        <style jsx>{`
          .imageColumn {
            width: 75px !important;
          }
        `}</style>
      </Table>
    </div>
  );
};

export default ProductsTable;
